import "../css/Menu.css";
import { Routes, Route, Link } from "react-router-dom";

import React, { useState } from 'react';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import PlayIcon from '../img/play-icon.png';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ArchiveIcon from '@mui/icons-material/Archive';
import Paper from '@mui/material/Paper';
import HomePage from "./pages/HomePage";
import PlayPage from "./pages/PlayPage";
import LoginPage from "./pages/LoginPage";
import ProfilePage from "./pages/ProfilePage";
import SettingsPage from "./pages/SettingsPage";
  
export default function FixedBottomNavigation() {

    const [value, setValue] = React.useState(0);
    const ref = React.useRef(null);

    const [show, setShow] = useState(true);
    const [profileInfo, setProfileInfo] = useState([]);
    const handleAuthenticated = (isAuthenticated) => {setAuthenticated(isAuthenticated)}
    const [authenticated, setAuthenticated] = useState("");

    const showProfilePage = () => {
        // should probs write this i guess
    }
  
    return (
        <div>
            <Box sx={{ pb: 7 }} ref={ref}>
            <CssBaseline />
                <Paper sx={{ position: 'fixed', bottom: 0, left: 0, right: 0 }} elevation={3}>
                    <BottomNavigation
                        showLabels={true}
                        value={value}
                        onChange={(event, newValue) => {
                            setValue(newValue);
                        }}
                    >
                        <Link to="/profile"><BottomNavigationAction label="PROFILE" onClick={showProfilePage} /></Link>
                        <Link to="/play"><BottomNavigationAction label="PLAY" icon={<FavoriteIcon />} /></Link>
                        <Link to="/settings"><BottomNavigationAction label="SETTINGS" icon={<ArchiveIcon />} /></Link>      
                    </BottomNavigation>
                </Paper>
            </Box>
            <Routes>
                <Route path="/" element={<PlayPage/>} />
                <Route path="/play" element={<PlayPage/>} />
                <Route 
                    path="/login"
                    element={
                        <LoginPage
                            authenticated={authenticated}
                            handleAuthenticated={handleAuthenticated}
                        />
                    }
                />
                <Route
                    path="/profile"
                    element={
                        <ProfilePage
                            profileInfo={profileInfo}
                            authenticated={authenticated}
                            handleAuthenticated={handleAuthenticated}
                        />
                    }
                />
                <Route path="/settings" element={<SettingsPage />} />
                <Route path="*" element={<p>Not Found</p>} />
            </Routes>
        </div>
    );
}
